import React, {Component} from 'react'
import RestaurantCard from '../Components/RestaurantCard'

class RestaurantContainer extends Component {
    render(){
        return(
            <div>
                <RestaurantCard />
            </div>
        )
    }
}

export default RestaurantContainer
